/* 基本設定 */
html, body {
  height: 100% !important;
  margin: 0 !important;
  border-radius: 64px !important;
  overflow: hidden !important;
  perspective: 1500px !important; /* 3D効果の強さ */
}

html {
  background-image: url(https://u.cubeupload.com/K_Orange/room.png) !important;
  background-repeat: no-repeat !important;
  background-size: cover !important;
}

body {
  transform-style: preserve-3d !important;
  transition: transform 1.25s ease !important; /* アニメーション */
  background: rgba(255, 255, 255, 0.2) !important;
  border-radius: 16px !important;
  box-shadow: 0 4px 30px rgba(0, 0, 0, 0.1), inset 0 4px 16px rgba(0, 0, 0, 0.3) !important;
  BAcKdroP-filter: blur(5px) !important;
  -webkit-backdrop-filter: blur(5px) !important;
  border: 24px solid rgba(255, 255, 255, 0.5) !important;
  color: #00000099 !important;
}

.som-link-content, 
body > div.sinkening-container > div:nth-child(2) > div > div > div > div > div.flex.-mt-\[1px\].relative.h-full > div.bg-linear-to-b.from-\[\#E6D4BE\].to-\[\#F6DBBA\].h-full.w-full.flex-1 > div > div.flex.flex-col.gap-4 > div > div.flex.items-center.w-full > div {
  color: #00000055 !important;
}

.card-content > * > * >*, 
.card-content > *, 
.text-som-dark, 
span {
  color: #000000aa !important;
}

body::before {
  background: rgba(255, 255, 255, 0.2) !important;
  backdrop-filter: blur(5px) !important;
width: 10000000px;
    height: 100000000px;
}

html::before {
  content: "" !important;
  position: fixed !important;
  opacity: 0.5 !important;
  text-shadow: 0 2px 16px rgba(0, 0, 0, 0.5) !important;
  top: -100 !important;
  text-align: center !important;
  width: 100vw !important;
  padding-top: 58px !important;
  font-size: 40px !important;
}

body > div.sinkening-container > div:nth-child(2) > div > div > div > div img {
  display: none !important;
}

body > div.sinkening-container > div:nth-child(2) > div > div > div > div > div.flex.-mt-\[1px\].relative.h-full > div.bg-linear-to-b.from-\[\#E6D4BE\].to-\[\#F6DBBA\].h-full.w-full.flex-1 {
  background: none !important;
}

svg {
  opacity: 0.25 !important;
}

path {
  fill: black !important;
  backdrop-filter: blur(5px) !important;
  box-shadow: 0 2px 16px rgba(0, 0, 0, 0.5) !important;
}

svg:hover {
  opacity: 0.5 !important;
  transition-duration: 200ms !important;
}

/* フォーカス時の回転効果 */
.focusable:focus {
  outline: none !important;
}

body > div.sinkening-container > div:nth-child(2) > div > div > div > div > div.flex.-mt-\[1px\].relative.h-full > div.w-\[46px\].h-full {
  width: 10px !important;
}

/* 要素Aがフォーカスされた場合の回転 */
body {
  transform: translateZ(-290px) rotateX(30deg) !important;
}

body:has(.card-with-gradient:hover) {
  transform: 
    translateZ(100px)
    translateX(150px)
    rotateY(-30deg)
    rotateX(10deg) !important;
}

/* 要素Bがフォーカスされた場合の回転 */
body:has(div.sinkening-container > div:nth-child(2) > div > div > div > div:hover) {
  transform:
    translateX(100px)
    translateY(50px)
    translateZ(100px)
    rotateY(-15deg)
    rotateX(10deg) !important;
}

body:has(#activities-list:hover) {
  transform:
    translateX(-20px)
    translateY(50px)
    translateZ(50px) 
    rotateY(12deg) 
    rotateX(-15deg) !important;
}

div {
  overflow: visible !important;
}

.card-with-gradient {
  background: rgba(255, 255, 255, 0.2) !important;
  border-radius: 16px !important;
  box-shadow: 0 4px 30px rgba(0, 0, 0, 0.2) !important;
  backdrop-filter: blur(5px) !important;
  -webkit-backdrop-filter: blur(5px) !important;
  border: 2px solid rgba(255, 255, 255, 0.3) !important;
  z-index: 99999 !important;
}

img.w-full.object-contain {
  background: rgba(255, 255, 255, 0) !important;
  box-shadow: 0 4px 30px rgba(0, 0, 0, 0.2) !important;
  backdrop-filter: blur(5px) !important;
  -webkit-backdrop-filter: blur(5px) !important;
  border: 2px solid rgba(255, 255, 255, 0.3) !important;
  z-index: 99999 !important;
}

.bg-som-highlight {
  display: none !important;
}

img.w-full.object-contain.cursor-pointer.hover:opacity-90.transition-opacity.rounded-lg.max-h-96 {
  background: rgba(255, 255, 255, 0) !important;
  box-shadow: 0 4px 30px rgba(0, 0, 0, 0.2) !important;
  backdrop-filter: blur(5px) !important;
  -webkit-backdrop-filter: blur(5px) !important;
  border: 2px solid rgba(255, 255, 255, 0.3) !important;
  z-index: 99999 !important;
}

.sinkening-container {
  transform: none !important;
}

.floating-balloon-container {
  display: none;
}

body > div.w-full.overflow-hidden {
  display: none;
}

*:not(img,html) {
  overflow: visible;
}

body {
  overflow-y: scroll;
}
